		//הזזת השאלות לכיוון טוטו באמצעות טיקר
		function tick() {
			//במידה והטיקר לא במצב מושהה
			if (createjs.Ticker.paused == false) {
				//משתנה פריט הוא בעצם הצינור שמתקרב לטוטו
				var parit = stage.getChildByName("myTextBox");
				var textBoxUnder = stage.getChildByName("myTextBox2");
				var txtObject = stage.getChildByName("ObjectTxt");
		
				parit.x -= 5;
				textBoxUnder.x -= 5;
		
				if (parit.x == 250) {
					doubleq = selected; // משתנה זה שומר את ערך ההרנדום כך שאוכל לתת תנאי בכדי ששאלה לא תופיע אחת אחרי השנייה
		
					var myArrayLoc = questions[mychoice][selected];
					if (intersect(stage.getChildByName("totoHit"), parit)) {
		
						$('*').off('keyup keydown keypress'); // תנטרל שימוש במקשים
		
						if (myArrayLoc[1] == true) { // במידה והיתה פגיעה והפריט נכון
		
							// תוסיף וי לצד התשובה הנכונה
							var vi = new lib.v();
							parit.addChild(vi);
							vi.x = 70;
							vi.y = 0;
							myArrayLoc[2] = true; // תגדיר תשובה זה כהושלמה
							// בר ההתקדמות יעלה
							stage.getChildByName("barColorName").gotoAndStop(myPosition);
							myPosition = myPosition + barPosition;
		
						} else { //במידה והיתה פגיעה והפריט לא נכון 
		
							var xi = new lib.x(); // תוסיף איקס לצד התשובה הנכונה
							parit.addChild(xi);
							xi.x = 70;
							xi.y = 0;
							stage.getChildByName("totoBtn").gotoAndPlay(13); // טוטו עצוב
							myArrayLoc[3]++; // ותעלה את מונה התשובות השגויות
						}
					} else { //במידה והייתה התחמקות
						if (myArrayLoc[1] == false) { //במידה והייתה התחמקות נכונה
							myArrayLoc[2] = true; // תגדיר תשובה זה כהושלמה
							// בר ההתקדמות יעלה
							stage.getChildByName("barColorName").gotoAndStop(myPosition);
							myPosition = myPosition + barPosition;
						} else // במידה והיתה התחמקות לא נכונה 
						{
							myArrayLoc[3]++; // תעלה את המונה באחד
		
						}
		
					}
				}
				if (parit.x == -50) { // אם הפריט הגיע לסוף המסף
					stage.removeChild(parit); // תסיר אותו מהבמה
					stage.removeChild(textBoxUnder)
					var myStatus = true;
					for (i = 0; i < questions[mychoice].length; i++) { // לולאה שתעבור על כל התאים במערך ותבדוק האם המשחק נגמר
						if (questions[mychoice][i][2] == false) { // במידה ואחד מהם היה פוךס סימן שהמשחק לא נגמר
							myStatus = false;
						}
					}
					if (myStatus == true) { // במידה והמשחק נגמר באמת
						createjs.Ticker.paused == true; // תעצור את התזוזות
						gameOverFunc();
					} else { // במידה והמשחק לא נגמר
						ObjectsCreate(); // תריץ את הפונקציה מחדש 
					}
				}
			}
		}
		
