		// פונקציה ללחיצה על רווח
		function handlekeypress(e) {
		
			if (e.keyCode == 39) { // לחיצה ימניה מהיר יותר
				if (myFPS < 45) {
					myFPS += 15;
					stage.getChildByName("mySignName").speedMark.x += 50;
					createjs.Ticker.setFPS(myFPS);
				}
			}
			if (e.keyCode == 37) { // לחיצה שמאלה לאט יותר
				if (myFPS > 15) {
					myFPS -= 15;
					stage.getChildByName("mySignName").speedMark.x -= 50;
					createjs.Ticker.setFPS(myFPS);
				}
			}
		
			if (e.keyCode == 32) { // בלחיצה על רווח טוטו יקפוץ
				var totoJump = stage.getChildByName("totoBtn");
				var totoHit = stage.getChildByName("totoHit");
				//קפיצה של טוטו
				totoJump.gotoAndPlay(108);
				var timeCheck = 0;
				//אינטרוול שנקודת המפגש שעל העף של טוטו תעוף ללמעלה ותחזור לאף של טוטו כעבור מספר שניות
				var timer = setInterval(function () {
					totoHit.y = 130;
					timeCheck++;
					if (timeCheck > 8) {
						clearInterval(timer);
						totoHit.y = 400;
					}
				}, 500);
			}
		}
		
